import React, {Component} from 'react';

const roomArr = ['room1','room2', 'room3', 'room4'];

class RoomApp extends Component {
   constructor(props){
       super(props);
        this.state  = {
            roomData : {}
        }

   }

   getRoomData = () => {
      var newObj = roomArr.reduce(function(obj,v,i){
        obj[v] = {
            checked : i > 0 ? false : true,
            key : v+"-key",
            data : {
                "adultCount" : 1,
                "childrenCount" : 0	
            }
        };
        return obj;
    }, {});
    this.setState({
        roomData : newObj 
    }) 
   }

   componentDidMount(){
    console.log(window);
        var data = {};
        if(localStorage && localStorage.getItem('roomData')){
            data = JSON.parse(localStorage.getItem('roomData'));
        } else {
            this.getRoomData();
        }


   }

   render(){
       return (
         <div>
               <h1>Hii RoomApp</h1>
           </div>
       )
   }

}

export default RoomApp;
